import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Services = () => {

   { const ShowCard=()=>{
        Sdata.map((val)=>{
            return(
            <Card 
                imgSrc={val.imgsrc}
                Service={val.service}
            />  
            )
        })
     }}
     ShowCard();
    return (
        <>

            <div className="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto ">
                        <div className="my-3 ">
                            <h2>Our Services</h2>
                        </div>
                        <div className="row gy-4">
                           <Card/>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Services;
